import PropTypes from 'prop-types';
import Label from '../../Label/Label';
import Input from '../../../shared/Input/Input';

const Account = props => {
    return (
        <div className='max-w-3xl flex flex-col  pr-10 xl:pr-16'>
            <div className='mb-20'>
                <h1 className='mb-7 text-xl'>Personal Information</h1>
                <div className='flex-col'>
                    <div className='flex-col md:flex mb-7'>
                        <div className='flex flex-col w-1/2 mr-6'>
                            <Label>First Name</Label>
                            <Input
                                type={'text'}
                                placeholder={'First Name'}
                                id={'firstName'}
                                className={'bg-gray-700 border-gray-600 text-indigo-700 w-full'}
                            />
                        </div>
                        <div className='flex-col md:flex  w-1/2'>
                            <Label>Last Name</Label>
                            <Input
                                type={'text'}
                                placeholder={'Last Name'}
                                id={'lastName'}
                                className={'bg-gray-700 border-gray-600 text-indigo-700 w-full'}
                            />
                        </div>
                    </div>
                    <div className='flex flex-col'>
                        <Label>Email</Label>
                        <Input
                            type={'email'}
                            placeholder={'Email'}
                            id={'email'}
                            className={'bg-gray-700 border-gray-600 text-indigo-700 w-full'}
                        />
                    </div>
                </div>
            </div>
            <div className='2'>
                <h1 className='mb-7 text-xl'>Personal Information</h1>
                <div className='flex mb-7'>
                    <div className='flex flex-col w-1/2 mr-6'>
                        <Label>API key</Label>
                        <Input
                            type={'text'}
                            placeholder={'API key'}
                            id={'apiKey'}
                            className={'bg-gray-700 border-gray-600 text-indigo-700 w-full'}
                        />
                    </div>
                    <div className='flex flex-col w-1/2'>
                        <Label>Secret Key</Label>
                        <Input
                            type={'text'}
                            placeholder={'Secret Key'}
                            id={'secretKey'}
                            className={'bg-gray-700 border-gray-600 text-indigo-700 w-full'}
                        />
                    </div>
                </div>
            </div>
        </div>
    );
};

Account.propTypes = {};

export default Account;
